!function(){const s=document.querySelector(".nav__burger"),t=document.querySelector(".nav__list");s.addEventListener("click",()=>{s.classList.contains("nav__burger--active")?s.classList.remove("nav__burger--active"):s.classList.add("nav__burger--active"),t.classList.contains("list--active")?t.classList.remove("list--active"):t.classList.add("list--active")})}();